sys_variable_value.value:
(function execute(inputs, outputs) {
  var now = new GlideDate();
  //var ditcoCs = new GlideRecord("x_g_dis_atat_ditco_contract_specialist");
  //ditcoCs.get(inputs.acquisition_package.primary_reviewer.sys_id);
  //gs.info("last name {0}", ditcoCs.last_name);
  //gs.info("last name without lookup {0}", inputs.acquisition_package.primary_reviewer.last_name);
  outputs.body = {
    actionablePackageReceivedDate: now.getByFormat("MM/dd/yyyy"),
    awardBySept30: "Y",
    awardRisk: "Low",
    createdBy: inputs.acquisition_package.primary_reviewer.last_name.toString()
  };
})(inputs, outputs);

